        // 00010000 etc etc...
        const canvas = document.createElement('canvas');
        canvas.width = 477; canvas.height = 1002;
        const ctx = canvas.getContext('2d');
        const img = new Image;
        img.src = "data:image/png;base64,"+sora;
        let out = "";
        img.onload = () => {
            ctx.drawImage(img, 0, 0, 119.25, 250.5);
            for (let y = 0; y < 250.5; y++) {
                for (let x = 0; x < 119.25; x++) {
                    const pixel = ctx.getImageData(x, y, 1, 1);
                    if (x > 118)
                        out += "<br/>";
                    if (pixel.data[0] == 0 && pixel.data[0] == 0 && pixel.data[0] == 0) {
                        out += "<div style='display: inline; color: black;'>0</div>";
                        continue;
                    }
                    out += '<div style="display: inline; color: rgb('+pixel.data[0]+', '+pixel.data[1]+', '+pixel.data[2]+');">'+rand()+'</div>';
                }
            }
            document.body.innerHTML += out;
        };

        const rand = (n = 1, p = "01") => {
            let text = "";
            for (var i = 0; i < n; i++)
                text += p.charAt(Math.floor(Math.random() * p.length));
            return text;
        }
